import React, { Component } from 'react';
import '../styles.css';
class List extends Component{
    constructor(props){
        super(props);
        this.state = {
            list : []
        }
    }

    componentDidMount(){
        this.getList();
    }

    getList = () => {
        fetch('http://localhost:4006/')
        .then(res =>res.json())
        .then(list => this.setState({list}))

    }

    render(){

        const {list} = this.state;

        return (
            <div >
              <h1 >List of Items</h1>
              {list.length ? (
                <div >
                  {list.map((item) => {
                    return(
                      <div className = 'List'>                       <table>
                         <tr>
                           <th>ProjectId</th>
                           <th>Depth</th>
                           <th>Metername</th>
                           <th>Meter Description</th>
                           <th>Meter Reading</th>
                           <th>Reading Date</th>
                         </tr>
                         <tr>
                          <td>{item.a_projectid}</td>
                          <td>{item.a_depth} </td>
                          <td>{item.a_metername} </td>
                          <td>{item.a_meterdesc} </td>
                          <td>{item.a_meterreading} </td>
                          <td>{item.a_readdate} </td>
                         </tr>

                       </table>
                      </div>
                    );
                  })}
                </div>
              ) : (
                <div>
                  <h2>No List Items Found</h2>
                </div>
              )
            }
            </div>
          );

        }
            
}

export default List;
